import React from 'react'
import Destination from './Animal'


export default function DestinationList({places}) {
    const allplaces =places.map(place => (
        <Destination 
           place={place}
           key={place.id}
           className="place-list"
        />
    ))
  return (
   <div className="place-list">{allplaces}</div>
  )
}
